        norm_1 = text_embeds.norm(p=2, dim=-1, keepdim=True)
        text_embeds_1 = text_embeds / norm_1
        text_embeds = norm_1 = None
        logit_scale = l_self_parameters_logit_scale_.exp()
        l_self_parameters_logit_scale_ = None
        t = image_embeds_1.t()
        matmul_112 = torch.matmul(text_embeds_1, t)
        t = None
        logits_per_text = matmul_112 * logit_scale
        matmul_112 = logit_scale = None
        logits_per_image = logits_per_text.T
        return (
            projection_state,
            pooler_output,
            hidden_states_416,
            pooled_output_1,
            logits_per_image,
            logits_per_text,
            text_embeds_1,
            image_embeds_1,
        )
